import React from 'react';
import './App.css';
import Main from './Main';
import 'bootstrap/dist/css/bootstrap.min.css';

class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      loading: true,
      questions: null
    }
  }
  async componentDidMount() {
    //const url = "";
    const response = await fetch('questions.json');
    const data = await response.json();
    this.setState({ questions: data.data[0] })
  }

  render() {
    return (
      <div id='main'>
        {this.state.loading ?
          <div>
              loading...
          </div> :
          <div>
            <Main
              question={this.state.questions.question1}
              type='checkbox'
            />
            <br></br>
            <Main
              question='Q2.This is the second question'
              type='TrueFalse'
            /></div>
        }
      </div>
    );
  }
}

export default App;
